import React from 'react';

function CurrentReservations(){
    return(
        <div id="reservations-page">
            <div id="reservations-header">
                <h1>Your Reservations</h1>
            </div>
            <div id="reservations-navbar">
                <button id="pending-reservations-button">Pending Reservations</button>
                <button id="approved-reservations-button">Approved Reservations</button>
                <button id="denied-reservations-button">Denied Reservations</button>
            </div>
            <div id="reservations-list-div">
            </div>
        </div>
    );
}

export default CurrentReservations;
